// NewCreatePayload builds a GameManagement service create endpoint payload.
func NewCreatePayload(body *CreateRequestBody) *gamemanagement.CreatePayload {
	v := &gamemanagement.CreatePayload{
		Name:        *body.Name,
		ReleaseDate: body.ReleaseDate,
		Developer:   body.Developer,
		Publisher:   body.Publisher,
	}
	if body.Genre != nil {
		v.Genre = make([]string, len(body.Genre))
		for i, val := range body.Genre {
			v.Genre[i] = val
		}
	}
	if body.Platforms != nil {
		v.Platforms = make([]string, len(body.Platforms))
		for i, val := range body.Platforms {
			v.Platforms[i] = val
		}
	}

	return v
}

// NewUpdatePayload builds a GameManagement service update endpoint payload.
func NewUpdatePayload(body *UpdateRequestBody, id uint64) *gamemanagement.UpdatePayload {
	v := &gamemanagement.UpdatePayload{
		ReleaseDate: body.ReleaseDate,
		Developer:   body.Developer,
		Publisher:   body.Publisher,
	}
	if body.Genre != nil {
		v.Genre = make([]string, len(body.Genre))
		for i, val := range body.Genre {
			v.Genre[i] = val
		}
	}
	if body.Platforms != nil {
		v.Platforms = make([]string, len(body.Platforms))
		for i, val := range body.Platforms {
			v.Platforms[i] = val
		}
	}
	v.ID = id

	return v
}

